function Show-CommandGUI(){
    [CmdletBinding()]
    Param(
        [parameter(
            Position = 0,
            Mandatory = $true,
            ValueFromPipeline = $true
        )]
        [ValidateNotNullOrEmpty()]
        $command
    )
    
    $hlpIcon=''
    
    $ParameterSets = Get-GroupedDynamicParameter -Parameters (Get-Command $command | Get-DynamicParameter)
    
    [string[]]$AllValidParameterNames = $ParameterSets.Group.name | select -Unique
    
    $winHeight = ($parameterSets | Measure-Object Count -Maximum).Maximum * 35 + 130
    $result =New-Window -FontSize 15 -Width 300 -MinWidth 300 -Height $winHeight -MinHeight $winHeight -Title $command  {
        #check whether mandatory controls on the selected tab of the tab control are filled
        New-Grid -Rows 20,*,30 -Columns *,Auto,Auto {
            New-Border -Column 3 -Width 22 -HorizontalAlignment Right {
                $byteArray = [System.Convert]::FromBase64String($hlpIcon)
                $memStream = New-Object System.IO.MemoryStream(,$byteArray)
                $bmpImage = New-Object System.Windows.Media.Imaging.BitmapImage
                $null = $bmpImage.BeginInit()
                $bmpImage.StreamSource = $memStream
                $null = $bmpImage.EndInit()
                New-Image -Source $bmpImage -Column 3 -row 0 -Width 20 -On_MouseEnter{
                    $this.Cursor = 'Hand'
                    $this.Parent.BorderThickness = 2
                    $this.Parent.BorderBrush = '#FF000000'
                } -On_MouseDown{
                    Get-Help $command -ShowWindow
                } -On_MouseLeave{
                    $this.Parent.BorderThickness = 0
                    $this.Parent.BorderBrush = '#FFFFFFFF'
                }
            }
            New-TabControl -Name TabControl -ColumnSpan 3 -row 1{
                foreach($parameterSet in ($parameterSets | where {$_.Name})){
                    New-TabItem  -Header $parameterSet.Name {
                        New-Grid -Rows (("30,"*$parameterSet.Count).Split(',',[StringSplitOptions]::RemoveEmptyEntries)) -Columns Auto,*,25 {
                            $row = 0
                            foreach($parameter in $parameterSet.Group){
                                $default = $parameter.Default
                                $toolTip = "Type: $($parameter.Type.FullName)`n"
                                if (($parameter | Get-Member -MemberType NoteProperty).Name -contains 'Position'){
                                    $toolTip += "Position: $($parameter.Position)`n"
                                }
                                $label = $parameter.Name + ':'
                                $sb = {}
                                if ($parameter.Mandatory){
                                    $label += ' *'
                                    $sb =  { 
                                        $tabControl = $this.Parent.Parent.Parent.Parent.Children |  where {$_ -is [System.Windows.Controls.TabControl]}
                                        $runButton = $this.Parent.Parent.Parent.Parent.Children |  where {$_.Name -eq "Run"}
                                        if ($runButton){
                                            $runButton.IsEnabled = (Assert-MandatoryTabControls $tabControl)
                                        }
                                    }
                                    $toolTip += 'Mandatory'
                                }
                                else{
                                    $toolTip += 'Optional'
                                }
                                New-Label $label -Column 0 -Row $row
                                if ($parameter.ValidateSet){
                                    New-ComboBox -Name $parameter.Name -items $parameter.ValidateSet -Column 1 -row ($Row) -Margin 3 -ColumnSpan 2 -ToolTip $toolTip -SelectedValue $default -On_SelectionChanged $sb
                                    $row++
                                    continue
                                }
                                elseif($parameter.Type.FullName -eq 'System.Management.Automation.SwitchParameter'){
                                    New-CheckBox -Name $parameter.Name -Column 1 -row $Row -Margin 3 -ColumnSpan 2 -VerticalAlignment Center -ToolTip $toolTip -IsChecked ($default -eq $true)
                                    $row++
                                    continue
                                }
                                elseif($parameter.Name -like '*file*'){
                                    New-TextBox -Name $parameter.Name -Column 1 -row $Row -Margin 3 -ToolTip $toolTip -On_TextChanged $sb -Text $default
                                    New-Button -Name "btn$($parameter.Name)" -Content "..." -Column 2 -row $Row -Margin 3 -On_Click{
                                        $path = Get-File
                                        ($this.Parent.Children | where {$_.Name -eq $this.Name.Remove(0,3)}).Text  = $path
                                    }
                                }
                                elseif($parameter.Name -like '*folder*'){
                                    New-TextBox -Name $parameter.Name -Column 1 -row $Row -Margin 3 -ToolTip $toolTip -On_TextChanged $sb -Text $default
                                    New-Button -Name "btn$($parameter.Name)" -Content "..." -Column 2 -row $Row -Margin 3 -On_Click{
                                        $path = Get-Folder
                                        ($this.Parent.Children | where {$_.Name -eq $this.Name.Remove(0,3)}).Text  = $path
                                    }
                        
                                }
                                else{
                                    $sbValidate = {}
                                    #build the script block dynamically based on the parameter attributes
                                    if ($parameter.ValidatePattern -or $parameter.ValidateLength -or $parameter.ValidateRange -or $parameter.ValidateScript){
                                        $sbText = @'
                                            #only if the tab that contains the control is selected and if the control contains text
                                            if ($this.Text -and $this.Parent.Parent.Header -eq ($this.parent.parent.parent.items | where {$_.isSelected}).Header){
                                                $message= ''
                                                $valid = $true
'@
                                        if ($parameter.ValidatePattern){
                                            $toolTip += "`nValidatePattern: $($parameter.ValidatePattern)"               
                                            $sbText += @"
                                                `n`$isValid = `$this.Text -match '$($parameter.ValidatePattern)'
                                                if (-not `$isValid){
                                                    `$message += "``nThe Text does not match the validation pattern '$($parameter.ValidatePattern)'"
                                                }
                                                `$valid = `$isValid -and `$valid                         
"@
                                        }
                                        if ($parameter.ValidateLength){
                                            $toolTip += "`nValidateLength: ($($parameter.ValidateLength -join ','))"
                                            $sbText += @"
                                                `n`$len = `$this.Text.Length
                                                `$min, `$max = $($parameter.ValidateLength[0]), $($parameter.ValidateLength[1])
                                                `$isValid = `$len -ge `$min -and `$len -le `$max
                                                if (-not `$isValid){
                                                    `$message += "`nThe Text does not match the required Length (`$min-`$max)"
                                                } 
                                                `$valid = `$isValid -and `$valid                          
"@
                                        }
                                        if ($parameter.ValidateRange){
                                            $toolTip += "`nValidateRange: ($($parameter.ValidateRange -join ','))"
                                            $sbText += @"
                                                `n`$min, `$max = $($parameter.ValidateRange[0]), $($parameter.ValidateRange[1])
                                                `$isValid = `$this.Text -ge `$min -and `$this.Text -le `$max
                                                if (-not `$isValid){
                                                    `$message += "`nThe Number does not fall within the required range (`$min-`$max)"
                                                } 
                                                `$valid = `$isValid -and `$valid                          
"@
                                        }
                                        if ($parameter.ValidateScript){
                                            $toolTip += "`nValidateScript: ($($parameter.ValidateScript))"
                                            $sbText += @"
                                                `n`$isValid = [bool](`$this.Text | where $($parameter.ValidateScript))
                                                if (-not `$isValid){
                                                    `$message += "``nThe Text does not pass the validation test '$($parameter.ValidateScript.ToString().Replace('$','`$'))'"
                                                } 
                                                `$valid = `$isValid -and `$valid                          
"@
                                        }
                                        $sbText += @"
                                            `n`$this.BorderThickness = 2
                                            if (`$valid){
                                                `$this.BorderBrush = 'Green'
                                                `$tabControl = `$this.Parent.Parent.Parent.Parent.Children |  where {`$_ -is [System.Windows.Controls.TabControl]}
                                                if ((Assert-MandatoryTabControls `$tabControl)){
                                                    (`$this.Parent.Parent.Parent.Parent.Children |  where {`$_.Name -eq "Run"}).IsEnabled = `$true
                                                }
                                            }
                                            else{
                                                `$this.BorderBrush = 'Red'
                                                (`$this.Parent.Parent.Parent.Parent.Children |  where {`$_.Name -eq "Run"}).IsEnabled = `$false
                                                [System.Windows.Forms.MessageBox]::Show(`$message, "Validation Error", "OK", "Warning")
                                            }}
"@

                                    $sbValidate = [ScriptBlock]::Create($sbText)
                                    }
                                New-TextBox -Name $parameter.Name -Column 1 -row $Row -Margin 3 -ColumnSpan 2 -ToolTip $toolTip `
                                     -On_TextChanged $sb -On_LostFocus $sbValidate -Text $default -Padding '0,0,0,2'

                                }
                                $row++
                            }
                        }
                    } 
                }
            } -On_SelectionChanged{
                #check for mandatory elements and whether they are filled
                if($_.Source -is [System.Windows.Controls.TabControl]){
                    ($this.Parent.Children  | where {$_.Name -eq "Run"}).isEnabled = (Assert-MandatoryTabControls $this)
                }
            }
            New-Button 'Run' -Name 'Run' -row 2 -Column 1 -Margin 3 -IsDefault -On_Click{
                #retrieve the values and close the gui
                $parent | Set-UIValue -passThru | Close-Control
               
            }
            New-Button 'Cancel' -row 2 -Column 2 -Margin 3 -IsCancel
        } -On_Loaded { 
            ($this.Children  | where {$_.Name -eq "Run"}).isEnabled = $false 
       }
    } -Show
    if ($result){
        [string[]]($result.Keys) | ? {$_ -notin $AllValidParameterNames} | ?{$result.Remove($_)}
        Invoke-Expression "$command @result"
    }
}
